INSERT INTO `tran_categories` VALUES (1,'dark-matter','Dark matter is a hypothetical kind of matter that cannot be seen with telescopes but accounts for most of the matter \nin the universe. The existence and properties of dark matter are inferred from its gravitational effects on visible matter, radiation, and the large-scale \nstructure of the universe.',1,6,'CATA',1,'2017-03-23 19:03:10',1,'2017-03-23 19:03:10',0),(2,'dark-energy','In physical cosmology and astronomy, dark energy is an unknown form of energy which permeates \nall of space and tends to accelerate the expansion of the universe.',1,6,'CATA',1,'2017-03-23 19:03:10',1,'2017-03-23 19:03:10',0),(3,'space-time','the geometry which merges space and time coordinates.',1,6,'CATA',1,'2017-03-23 19:03:10',1,'2017-03-23 19:03:10',0),(4,'speed-of-light','The finite speed at which light travels. Unless otherwise stated, usually refers to the fundamental constant c, the speed of light in a perfect vacuum.\nApproximately equal to 3 × 10 to power 10 cm/sec.',1,6,'CATA',1,'2017-03-23 19:03:10',1,'2017-03-23 19:03:10',0),(5,'mars','Mars is the fourth planet from the Sun and the second smallest planet in the Solar System, after Mercury. Named after the Roman god of war, it is often \nreferred to as the \"Red Planet\" because the iron oxide prevalent on its surface gives it a reddish appearance.',1,6,'CATA',1,'2017-03-23 19:03:10',1,'2017-03-23 19:03:10',0),(6,'islam','Islam is a monotheistic, Abrahamic religion articulated by the Quran, a religious text considered by its adherents to be the verbatim \nword of God (Allah), and, for the vast majority of adherents, by the teachings and normative example (called the sunnah, composed of accounts called hadith) of Muhammad (c. 570–8 June 632 CE), considered by most of them to be the last prophet of God. An adherent of Islam is called a Muslim (sometimes spelled Moslem).',2,6,'CATA',1,'2017-03-23 19:03:10',1,'2017-03-23 19:03:10',0),(7,'dwarf-planet','a celestial body resembling a small planet but lacking certain technical criteria that are required for it to be classed as such.',1,6,'CATA',2,'2017-04-13 01:25:43',2,'2017-04-13 01:26:03',0),(8,'google-fi','Through new technology developed, Project Fi puts you on the best available network between Wi-Fi and three 4G LTE networks. ... Project Fi has partnered with Sprint, T-Mobile, and U.S. Cellular, three of the leading carriers in the US, to provide our service.',1,6,'CATA',2,'2017-04-13 01:56:22',2,'2017-04-13 01:56:40',0),(9,'google-fiber','Google Fiber is part of the Access division of Alphabet Inc. It provides fiber-to-the-premises service in the United States, providing broadband Internet and IPTV to a small and slowly increasing number of locations. \r\n\r\nIn mid-2016, Google Fiber had 68,715 television subscribers and was estimated to have about 453,000 broadband customers.',1,6,'CATA',2,'2017-04-18 20:25:53',2,'2017-04-18 20:26:07',0),(10,'solar-energy','Solar energy is radiant light and heat from the Sun that is harnessed using a range of ever-evolving technologies such as solar heating, photovoltaics, solar thermal energy, solar architecture, molten salt power plants and artificial photosynthesis.',1,6,'CATA',2,'2017-07-10 13:40:55',2,'2017-07-10 13:42:08',0),(11,'space-x','SpaceX designs, manufactures and launches advanced rockets and spacecraft. The company was founded in 2002 to revolutionize space technology, with the ultimate goal of enabling people to live on other planets.',1,6,'CATA',2,'2017-07-12 19:26:56',2,'2017-07-12 19:27:04',0),(12,'bitcoin','Bitcoin is a decentralized digital currency that enables instant payments to anyone, anywhere in the world. Bitcoin uses peer-to-peer technology to operate with no central authority: transaction management and money issuance are carried out collectively by the network.',1,6,'CATA',2,'2017-12-07 20:41:20',2,'2017-12-07 20:41:50',0),(13,'apple ','Apple Inc. is an American multinational technology company headquartered in Cupertino, California that designs, develops, and sells consumer electronics, computer software, and online services. The company\'s hardware products include the iPhone smartphone, the iPad tablet computer, the Mac personal computer, the iPod portable media player, the Apple Watch smartwatch, the Apple TV digital media player, and the HomePod smart speaker.',1,6,'CATA',2,'2017-12-11 20:22:33',2,'2017-12-11 20:22:41',0),(14,'net-neutrality','Net neutrality is the principle that Internet service providers must treat all data on the Internet the same, and not discriminate or charge differently by user, content, website, platform, application, type of attached equipment, or method of communication.For instance, under these principles, internet service providers are unable to intentionally block, slow down or charge money for specific websites and online content.',1,6,'CATA',2,'2017-12-12 16:17:54',2,'2017-12-12 16:19:37',0),(15,'internet','The Internet is the global system of interconnected computer networks that use the Internet protocol suite (TCP/IP) to link devices worldwide. It is a network of networks that consists of private, public, academic, business, and government networks of local to global scope, linked by a broad array of electronic, wireless, and optical networking technologies. ',1,6,'CATA',2,'2017-12-12 16:19:31',2,'2017-12-12 16:19:37',0),(16,'google-home','Google Home is a brand of smart speakers developed by Google. The first device was announced in May 2016 and released in the United States in November 2016, with subsequent releases globally throughout 2017.',1,6,'CATA',2,'2017-12-16 19:02:05',2,'2017-12-16 19:04:02',0),(17,'google','Google LLC is an American multinational technology company that specializes in Internet-related services and products. These include online advertising technologies, search, cloud computing, software, and hardware. Google was founded in 1998 by Larry Page and Sergey Brin while they were Ph.D. students at Stanford University, in California.',1,6,'CATA',2,'2017-12-16 19:03:16',2,'2017-12-16 19:04:02',0),(18,'amazon','Amazon.com, Inc., commonly known as Amazon, is an American electronic commerce and cloud computing company based in Seattle, Washington that was founded by Jeff Bezos on July 5, 1994. The tech giant is the largest Internet-based retailer in the world by total sales and market capitalization',1,6,'CATA',2,'2017-12-17 16:28:25',2,'2017-12-17 16:29:58',0),(19,'amazon-alexa','Alexa is an intelligent personal assistant developed by Amazon, first used in the Amazon Echo and the Amazon Echo Dot devices developed by Amazon Lab126. It is capable of voice interaction, music playback, making to-do lists, setting alarms, streaming podcasts, playing audiobooks, and providing weather, traffic, and other real-time information, such as news. Alexa can also control several smart devices using itself as a home automation system you can change \"Alexa\'s\" name and many other things.',1,6,'CATA',2,'2017-12-17 16:29:50',2,'2017-12-17 16:29:58',0),(20,'blink','The Blink Video Doorbell provides customers with HD video alerts, motion-detection, live streaming video with 2-way audio',1,6,'CATA',2,'2017-12-20 18:13:16',2,'2017-12-20 18:15:31',0),(21,'home-security','Home security is both the security hardware in place on a property as well as personal security practices. Security hardware includes doors, locks, alarm systems, lighting, motion detectors, security camera systems, etc. that are installed on a property; personal security involves practices such as ensuring doors are locked, alarms activated, windows closed, extra keys not hidden outside, etc.',1,6,'CATA',2,'2017-12-20 18:14:45',2,'2017-12-20 18:15:31',0),(22,'augmented-reality','Augmented reality (AR) is a live direct or indirect view of a physical, real-world environment whose elements are \"augmented\" by computer-generated or extracted real-world sensory input such as sound, video, graphics, haptics or GPS data. ',1,6,'CATA',2,'2017-12-21 15:50:31',2,'2017-12-21 15:51:55',0),(23,'pokemon-go','Pokémon Go is a free-to-play, location-based augmented reality game developed by Niantic for iOS and Android devices. The game was the result of a collaboration between Niantic and Nintendo, by way of The Pokémon Company, and was initially released in selected countries in July 2016',1,6,'CATA',2,'2017-12-21 15:51:46',2,'2017-12-21 15:51:55',0),(24,'iPhone','iPhone is a line of smartphones designed and marketed by Apple Inc. They run Apple\'s iOS mobile operating system. The first generation iPhone was released on June 29, 2007, and there have been multiple new hardware iterations with new iOS releases since.',1,6,'CATA',2,'2017-12-21 15:59:43',2,'2017-12-21 16:00:26',0),(25,'lithium-ion-battery','A lithium-ion battery or Li-ion battery (abbreviated as LIB) is a type of rechargeable battery in which lithium ions move from the negative electrode to the positive electrode during discharge and back when charging. Li-ion batteries use an intercalated lithium compound as one electrode material, compared to the metallic lithium used in a non-rechargeable lithium battery. ',1,6,'CATA',2,'2017-12-27 17:44:38',2,'2017-12-27 17:46:51',0),(26,'tesla-inc','Tesla, Inc. (formerly Tesla Motors) is an American automaker, energy storage company, and solar panel manufacturer based in Palo Alto, California. Founded in 2003, the company specializes in electric cars, lithium-ion battery energy storage, and residential photovoltaic panels (through the subsidiary company SolarCity). The additional products Tesla sells include the Tesla Powerwall and Powerpack batteries, solar panels and solar roof tiles.',1,6,'CATA',2,'2017-12-27 17:46:21',2,'2017-12-27 17:46:51',0),(27,'android','Android is a mobile operating system developed by Google, based on a modified version of the Linux kernel and other open source software and designed primarily for touchscreen mobile devices such as smartphones and tablets. ',1,6,'CATA',2,'2018-01-29 19:02:44',2,'2018-01-29 19:02:53',0);
