INSERT INTO `tran_question_answers` VALUES (3,5,'These devices are the first smartphones that support google fi network of networks. \r\n\r\nThey work with the Project Fi SIM card, which supports multiple cellular networks, and have a state-of-the-art cellular radio tuned to work across network types.',2,'2017-04-18 17:58:47',2,'2017-04-18 17:58:47',0),(4,7,'<p><strong>What is fiber optics? </strong></p>\r\n<p>We\'re used to the idea of information traveling in different ways. When we speak into a landline telephone, a wire cable carries the sounds from our voice into a socket in the wall, where another cable takes it to the local telephone exchange. Cellphones work a different way: they send and receive information using invisible radio waves&mdash;a technology called wireless because it uses no cables. Fiber optics works a third way. It sends information coded in a beam of light down a glass or plastic pipe. It was originally developed for endoscopes in the 1950s to help doctors see inside the human body without having to cut it open first. In the 1960s, engineers found a way of using the same technology to transmit telephone calls at the speed of light (normally that\'s 186,000 miles or 300,000 km per second in a vacuum, but slows to about two thirds this speed in a fiber-optic cable).</p>\r\n<p><strong>Optical technology</strong></p>\r\n<p>Fiber optic cables A fiber-optic cable is made up of incredibly thin strands of glass or plastic known as optical fibers; one cable can have as few as two strands or as many as several hundred. Each strand is less than a tenth as thick as a human hair and can carry something like 25,000 telephone calls, so an entire fiber-optic cable can easily carry several million calls. Fiber-optic cables carry information between two places using entirely optical (light-based) technology. Suppose you wanted to send information from your computer to a friend\'s house down the street using fiber optics. You could hook your computer up to a laser, which would convert electrical information from the computer into a series of light pulses. Then you\'d fire the laser down the fiber-optic cable. After traveling down the cable, the light beams would emerge at the other end. Your friend would need a photoelectric cell (light-detecting component) to turn the pulses of light back into electrical information his or her computer could understand. So the whole apparatus would be like a really neat, hi-tech version of the kind of telephone you can make out of two baked-bean cans and a length of string! Each strand is made of optically pure glass and is thinner than a human hair. Picture by Tech. Sgt. Brian Davidson, courtesy of US Air Force. How fiber-optics works A fiber optic cable bent around in a loop with Each strand is made of optically pure glass and is thinner than a human hair.</p>\r\n<p><strong>How fiber-optics works</strong>&nbsp;</p>\r\n<p>A fiber optic cable bent around in a loop with a red light shining down it. How total internal reflection keeps light rays inside a fiber-optic cable. Light travels down a fiber-optic cable by bouncing repeatedly off the walls. Each tiny photon (particle of light) bounces down the pipe like a bobsleigh going down an ice run. Now you might expect a beam of light, traveling in a clear glass pipe, simply to leak out of the edges. But if light hits the glass at a really shallow angle (less than 42 degrees), it reflects back in again&mdash;as though the glass were really a mirror. This phenomenon is called total internal reflection. It\'s one of the things that keeps light inside the pipe. Artwork: Right: Total internal reflection keeps light rays bouncing down the inside of a fiber-optic cable. The other thing that keeps the light in the pipe is the structure of the cable, which is made up of two separate parts. The main part of the cable&mdash;in the middle&mdash;is called the core and that\'s the bit the light travels through. Wrapped around the outside of the core is another layer of glass called the cladding. The cladding\'s job is to keep the light signals inside the core. It can do this because it is made of a different type of glass to the core. (More technically, the cladding has a lower refractive index.)</p>',2,'2017-04-18 20:35:31',2,'2017-07-27 15:58:54',0),(6,9,'<p><strong>Affordability </strong></p>\r\n<p>Solar Roof is more affordable than conventional roofs because in most cases, it ultimately pays for itself by reducing or eliminating a home&rsquo;s electricity bill. Consumer Reports estimates that a Solar Roof for an average size U.S. home would need to cost less than $24.50 per square foot to cost competitive with a regular roof. The cost of Solar Roof is less. The typical homeowner can expect to pay $21.85 per square foot for Solar Roof and benefit from a beautiful new roof that also increases the value of their home. Solar Roof uses two types of tiles&mdash;solar and non-solar. Looking at the roof from street level, the tiles look the same. Customers can select how many solar tiles they need based on their home&rsquo;s electricity consumption.</p>\r\n<p>&nbsp;For example, households that charge an electric vehicle every day may want more solar tiles on their roof. In doing our own research on the roofing industry, it became clear that roofing costs vary widely, and that buying a roof is often a worse experience than buying a car through a dealership. Initial contracts tend to be overly optimistic, and later customers face hidden costs that were never mentioned up front. Tesla believes in transparency and putting the customer in control. That&rsquo;s why they created a Solar Roof calculator that lets homeowners estimate the upfront price of Solar Roof, as well as the value of the energy it can generate for their home. The calculator is based on factors like roof size, the average local price of electricity, and how much sunlight a neighborhood receives throughout the year. The cost of our non-solar tiles is comparable to regular roofing tiles. Although the cost of our solar tiles is more expensive up front, it can be more than offset by the value of energy the tiles produce. In many cases, the reduction in a home&rsquo;s electricity bill over time will be greater than the cost of the roof.</p>\r\n<p><strong>Design &amp; Durability</strong></p>\r\n<p>Solar Roof will be available in a variety of designs, including Smooth and Textured (available this year) and Tuscan and Slate (available early 2018). Made with tempered glass, Solar Roof tiles are more than three times stronger than standard roofing tiles, yet half the weight. They do not degrade over time like asphalt or concrete. Solar Roof is the most durable roof available and the glass itself will come with a warranty for the lifetime of your house, or infinity, whichever comes first.</p>',2,'2017-07-10 15:39:05',2,'2017-07-26 16:04:26',0),(7,13,'<h3>FALCON 9</h3>\r\n<p>Falcon 9 is a two-stage rocket designed and manufactured by SpaceX for the reliable and safe transport of satellites and the Dragon spacecraft into orbit. Falcon 9 is the first orbital class rocket capable of re-flight. SpaceX believes rocket reusability is the key breakthrough needed to reduce the cost of access to space and enable people to live on other planets.</p>\r\n<p>Falcon 9 was designed from the ground up for maximum reliability. Falcon 9&rsquo;s simple two-stage configuration minimizes the number of separation events -- and with nine first-stage engines, it can safely complete its mission even in the event of an engine shutdown.</p>\r\n<p>Falcon 9 made history in 2012 when it delivered Dragon into the correct orbit for rendezvous with the International Space Station, making SpaceX the first commercial company ever to visit the station. Since then Falcon 9 has made numerous trips to space, delivering satellites to orbit as well as delivering and returning cargo from the space station for NASA. Falcon 9, along with the Dragon spacecraft, was designed from the outset to deliver humans into space and under an agreement with NASA, SpaceX is actively working toward this goal.</p>\r\n<h3>FALCON HEAVY</h3>\r\n<p>When Falcon Heavy lifts off in 2017, it will be the most powerful operational rocket in the world by a factor of two. With the ability to lift into orbit over 54 metric tons (119,000 lb)--a mass equivalent to a 737 jetliner loaded with passengers, crew, luggage, and fuel--Falcon Heavy can lift more than twice the payload of the next closest operational vehicle, the Delta IV Heavy, at one-third the cost. Falcon Heavy draws upon the proven heritage and reliability of Falcon 9.&nbsp;</p>\r\n<p>Its first stage is composed of three Falcon 9 nine-engine cores whose 27 Merlin engines together generate more than 5 million pounds of thrust at liftoff, equal to approximately eighteen 747 aircraft. Only the Saturn V moon rocket, last flown in 1973, delivered more payload to orbit. Falcon Heavy was designed from the outset to carry humans into space and restores the possibility of flying missions with the crew to the Moon or Mars.</p>\r\n<h3>DRAGON</h3>\r\n<p>Dragon is a free-flying spacecraft designed to deliver both cargo and people to orbiting destinations. Dragon made history in 2012 when it became the first commercial spacecraft in history to deliver cargo to the International Space Station and safely return cargo to Earth, a feat previously achieved only by governments. It is the only spacecraft currently flying that is capable of returning significant amounts of cargo to Earth. Currently, Dragon carries cargo to space, but it was designed from the beginning to carry humans. Under an agreement with NASA, SpaceX is now developing the refinements that will enable Dragon to fly crew. Dragon\'s first manned test flight is expected to take place as early as 2018.</p>',2,'2017-08-01 20:28:34',2,'2017-08-01 20:28:34',0),(8,10,'<p><strong>What is the Tesla Powerwall?</strong></p>\r\n<p>Tesla describes the Powerwall as a &ldquo;rechargeable lithium-ion battery with liquid thermal control.&rdquo; &nbsp;It is one of a few companies in the residential energy storage market that makes small-scale batteries for home energy storage. The first-generation Powerwall launched in April 2015, and an updated Powerwall 2.0 was announced in October 2016. The Powerwall 2.0 is priced at $5,500.</p>\r\n<p>Tesla battery packs are an ideal pairing for solar panel systems, especially in the case of off-grid projects where homeowners need or want to become fully independent of their utility. A solar storage solution like the Tesla Powerwall allows you to maintain a sustained power supply during the day or night. But how does Tesla&rsquo;s battery pack measure up against all the other home energy storage options? Read on to learn more about Tesla Powerwall&rsquo;s cost, technology, and warranty coverage.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>How does Tesla\'s battery work?</strong></p>\r\n<p>Tesla and other electric carmakers have invested a significant amount of time and money into developing long-lasting battery technology. An enduring concern of American car buyers is that electric vehicles don\'t hold enough charge and that they could be left stranded along the roadside as a result. While Tesla&rsquo;s research into battery technology was initially focused on the auto market, manufacturing a Tesla battery pack for home use is another way for the company to bring its existing inventions to market.</p>\r\n<p>&nbsp;</p>\r\n<p>As with other energy storage products, the Tesla battery pack is sized for day-to-day use at your home and is usually paired with a home solar panel system. When your solar panels produce more electricity than you can use in your home, the excess is stored in the battery pack instead of being sent back into the electric grid. Later, when your panels aren&rsquo;t producing enough electricity, you can use the electricity stored in your Powerwall instead of having to buy it from your utility.</p>\r\n<p>Normally, this process happens over the course of a day: when the sun is high in the sky and your solar panels are producing more electricity than you can use, the surplus energy is stored in your Tesla Powerwall. As the sun goes down and your solar panel production decreases, you draw on the electricity that you stored during the sunniest part of the day. Essentially, the Powerwall helps you balance out your electricity production and usage over the course of the day.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>How much does it cost? (2017)</strong></p>\r\n<p>One 14 kWh Powerwall battery &nbsp;$5,500</p>\r\n<p>Supporting hardware &nbsp;$700</p>\r\n<p>Price for Powerwall equipment &nbsp;$6,200</p>\r\n<p>Requires $500 deposit for each Powerwall</p>\r\n<p>Typical installation cost ranges from $800 to $2,000. This does not include solar installation, electrical upgrades (if necessary), taxes, permit fees, or any retailer/connection charges that may apply. Installation cost will vary based on your electrical panel, and where you would like your Powerwall installed. The installation will be scheduled after you place your order.</p>',2,'2017-09-19 14:24:25',2,'2017-09-19 14:24:25',0),(9,11,'<p>Well, it depends on which Tesla model you are charging. And also which charger you are using to charge the car.</p>\r\n<p>Each Tesla model takes a different amount of time to fully charge as they have a different range.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Model -&nbsp;</strong>Model S - 75</p>\r\n<p><strong>Range (max) -&nbsp;</strong>265 mi&nbsp;</p>\r\n<p><strong>Wall Connector - 75 kWh &nbsp;-&nbsp;</strong>07:41 hours&nbsp;</p>\r\n<p><strong>Wall Connector - 100 kWh -&nbsp;</strong>5:06 hours</p>\r\n<p><strong>Supercharger -&nbsp;</strong>1:03 hours</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Model -&nbsp;</strong>Model S - 75D</p>\r\n<p><strong>Range (max) -&nbsp;</strong>275 mi&nbsp;&nbsp;</p>\r\n<p><strong>Wall Connector - 75 kWh &nbsp;-&nbsp;</strong>8 hours</p>\r\n<p><strong>Wall Connector - 100 kWh -&nbsp;</strong>5:18 hours&nbsp;</p>\r\n<p><strong>Supercharger -&nbsp;</strong>1:06 hours</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Model -&nbsp;</strong>Model S - 100D</p>\r\n<p><strong>Range (max) -&nbsp;</strong>351 mi &nbsp;</p>\r\n<p><strong>Wall Connector - 75 kWh &nbsp;-&nbsp;</strong>&nbsp;9 hours</p>\r\n<p><strong>Wall Connector - 100 kWh -&nbsp;</strong>6 hours&nbsp;</p>\r\n<p><strong>Supercharger -&nbsp;</strong>1:25 hours</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Model -&nbsp;</strong>Model S - P100D</p>\r\n<p><strong>Range (max) -&nbsp;</strong>337 mi&nbsp;&nbsp;</p>\r\n<p><strong>Wall Connector - 75 kWh &nbsp;-&nbsp;</strong>&nbsp;8:45 hours</p>\r\n<p><strong>Wall Connector - 100 kWh -&nbsp;</strong>5:50 hours&nbsp;</p>\r\n<p><strong>Supercharger -&nbsp;</strong>1:20 hours&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Model -&nbsp;</strong>Model X</p>\r\n<p><strong>Range (max) -&nbsp;</strong>289 mi&nbsp;&nbsp;</p>\r\n<p><strong>Wall Connector - 75 kWh &nbsp;-&nbsp;</strong>&nbsp;9:32 hours</p>\r\n<p><strong>Wall Connector - 100 kWh -&nbsp;</strong>6:20 hours&nbsp;</p>\r\n<p><strong>Supercharger -&nbsp;</strong>1:21 hours&nbsp; &nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Model -&nbsp;</strong>Model 3&nbsp;</p>\r\n<p><strong>Range (max) -&nbsp;</strong>315 mi&nbsp;</p>\r\n<p><strong>Wall Connector - 75 kWh &nbsp;-&nbsp;</strong>&nbsp;8:32 hours</p>\r\n<p><strong>Wall Connector - 100 kWh -&nbsp;</strong>6 hours</p>\r\n<p><strong>Supercharger -&nbsp;</strong>1:15 hours &nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Charge times are approximate. Charge cost assumes a national average of $0.12 per kilowatt hour. Gasoline savings assumes 21 mpg at $2.70 per gallon.</p>\r\n<p>A Tesla Wall Connector installed on a 60 amp / 240-volt circuit breaker will achieve the maximum charge rate of 11.5 kW for 75 kWh configured vehicles.</p>\r\n<p>A Tesla Wall Connector installed on a 90 amp / 240-volt circuit breaker will achieve the maximum charge rate of 17.2 kW for a 100 kWh configured vehicle.</p>\r\n<p>&nbsp;</p>\r\n<p>I hope this helps!!</p>',2,'2017-09-19 15:16:11',0,'2017-09-19 15:38:03',0),(10,15,'<h4>How to use Bitcoin</h4>\r\n<p>&nbsp;</p>\r\n<h5><strong>1. Choose your wallet</strong></h5>\r\n<p>You can bring a Bitcoin wallet in your everyday life with your mobile or you can have a wallet only for online payments on your computer. In any case, choosing your wallet can be done in a minute.</p>\r\n<h5><strong>2. Get Bitcoin</strong></h5>\r\n<p>You can get Bitcoin by accepting it as a payment for goods and services. There are also several ways you can buy Bitcoin.</p>\r\n<h5><strong>3. Spend Bitcoin</strong></h5>\r\n<p>There is a growing number of services and merchants accepting Bitcoin all over the world. You can use Bitcoin to pay them and rate your experience to help honest businesses to gain more visibility.</p>\r\n<p>&nbsp;</p>\r\n<h4>How to accept Bitcoin</h4>\r\n<p>&nbsp;</p>\r\n<h5><strong>1. Processing payments</strong></h5>\r\n<p>You can process payments and invoices by yourself or you can use merchant services and deposit money in your local currency or bitcoins. Most point of sales businesses uses a tablet or a mobile phone to let customers pay with their mobile phones.</p>\r\n<h5><strong>2. Accounting and taxes</strong></h5>\r\n<p>Merchants often deposit and display prices in their local currency. In other cases, Bitcoin works similarly to a foreign currency. To get appropriate guidance regarding tax compliance for your own jurisdiction, you should contact a qualified accountant.</p>\r\n<h5><strong>3. Gaining visibility</strong></h5>\r\n<p>There is a growing number of users searching for ways to spend their bitcoins. You can submit your business to online directories to help them easily find you. You can also display the Bitcoin logo on your website or your brick and mortar business.</p>',2,'2017-12-04 03:06:04',0,'2017-12-04 16:12:11',0),(11,16,'<p>Siri, what\'s that song?</p>\r\n<p>Apple must be planning to integrate Shazam and Siri, so siri can tell you more about the song that you are listening to.</p>\r\n<p>Here is the statement that Apple gave today.</p>\r\n<p>&ldquo;We are thrilled that Shazam and its talented team will be joining Apple. Since the launch of the App Store, Shazam has consistently ranked as one of the most popular apps for iOS. Today, it&rsquo;s used by hundreds of millions of people around the world, across multiple platforms. Apple Music and Shazam are a natural fit, sharing a passion for music discovery and delivering great music experiences to our users. We have exciting plans in store, and we look forward to combining with Shazam upon approval of today&rsquo;s agreement.&rdquo;<u></u></p>',2,'2017-12-11 20:30:07',0,'2017-12-11 20:35:39',0),(12,17,'<p>When you go online you have certain expectations. You expect to be connected to whatever website you want. You expect that your ISP isn&rsquo;t messing with the data and is connecting you to all sites. You expect to be in control of your&nbsp;web experience.</p>\r\n<p>That\'s what Net Neutrality is.</p>\r\n<p>The basic principle of&nbsp;Net Neutrality&nbsp;that prohibits&nbsp;ISPs like AT&amp;T, Comcast and Verizon from speeding up, slowing down or blocking any content. Internet has always worked by Net Neutrality.</p>\r\n<p>In 2015, millions of activists pressured the Federal Communications Commission (FCC)&nbsp;to adopt historic Net Neutrality rules that keep the internet free and open which&nbsp;allows&nbsp;us to share and access information of&nbsp;our picking without interference.</p>\r\n<p>Trump&rsquo;s FCC chairman, Ajit Pai, wants to&nbsp;get rid of&nbsp;Net Neutrality. In May, the FCC voted to let Pai&rsquo;s internet-killing plan move forward. That summer, the agency was flooded with more than 20 million comments. The vast majority of people wanted Net Neutrality.<u></u></p>\r\n<p>Unlike the open internet that has paved the way for so much innovation and given a platform to people who have historically been shut out, it would become a closed-down network where cable and phone companies call the shots and decide which websites, content or applications succeed.</p>\r\n<p>This would have an enormous impact. ISPs like AT&amp;T, Comcast and Verizon who gets famous and who does not. They&rsquo;d be able to block websites or content they don&rsquo;t like or applications that compete with their own offerings.</p>\r\n<p>There will be devasting&nbsp;effects&nbsp;on marginalized communities media outlets have misrepresented or failed to serve. People of color, the LGBTQ community, indigenous peoples and religious minorities in the United States rely on the open internet to organize, access economic and educational opportunities, and fight back against systemic discrimination.</p>\r\n<p>Fighting oppression without Net Neutrality will be impossible on web? What would happen to social movements like the Movement for Black Lives? If internet service providers only let incumbents succeed then&nbsp;what will happen to&nbsp;next disruptive technology, business or company emerge?<u></u></p>',2,'2017-12-12 16:20:58',0,'2017-12-12 16:44:09',0),(13,18,'<p>Google Home Mini is the newest addition to the Google Home family. About the size of a donut, it has all the smarts of the Google Assistant and gives you hands-free help in any room of your house.You can grab it online from the Google Store or online or on shelves of Best Buy, Walmart, Target and other stores.</p>\r\n<p>Just start with &ldquo;Hey Google&rdquo; to get answers from your Google Assistant, tackle your day, enjoy music or TV shows, and control your compatible smart home devices. And with Voice Match, the Assistant can tell your voice from others&mdash;up to six people can get personal assistance on each device.</p>\r\n<p><strong>Here are six fun things you can do with your Mini:</strong></p>\r\n<p><strong>1.Find my phone:</strong> When you lose your phone in the couch cushions, your Assistant can find it for you. &ldquo;Hey Google, find my phone&rdquo; will ring your Android phone (even if it&rsquo;s on silent) or your iPhone.</p>\r\n<p><strong>2.Set a sleep timer:</strong> Fall asleep to the sweet sounds of your favorite music or podcast by saying, &ldquo;Hey Google, set a sleep timer for 30 minutes.&rdquo;</p>\r\n<p><strong>3.Play news by voice on your TV:</strong> Stay on top of current events with YouTube news playlists from sources like ABC, Fox and NBC. With a Chromecast-connected TV, you can ask say: &ldquo;Hey Google, play the news on my TV&rdquo; or &ldquo;Ok Google, play sports news on my TV.&rdquo;</p>\r\n<p><strong>4.Turn the TV on and off:</strong> With Google Home, Chromecast, and a compatible TV you can just say &ldquo;Hey Google, turn off the TV.&rdquo;</p>\r\n<p><strong>5.Enable night mode:</strong> In night mode, Mini&rsquo;s lights dim and the volume lowers so that you you don&rsquo;t disturb others in your household when it&rsquo;s late (or early).</p>\r\n<p><strong>6.Set a default TV or speaker:</strong> Choose a Chromecast-connected TV to be your default screen, so you don&rsquo;t need to mention the device\'s name in your voice command. When you say &ldquo;Play yoga videos,&rdquo; they&rsquo;ll play on the TV you&rsquo;ve set as the default. It works the same way for speakers connected to Chromecast Audio&mdash;you can designate a group of speakers that cover several rooms (&ldquo;first floor,&rdquo; for example) as the default. Then say &ldquo;Hey Google, play workout playlist&rdquo; and it will automatically start playing on that group of speakers</p>',2,'2017-12-16 19:18:27',2,'2017-12-16 19:18:27',0),(14,19,'<p><strong>What is Echo Dot? - </strong></p>\r\n<p>Echo Dot is a hands-free, voice-controlled device with a small built-in speaker&mdash;it can also connect to your speakers or headphones over Bluetooth or through a 3.5 mm audio cable to deliver stereo sound to the speakers you choose. Dot connects to the Alexa Voice Service to play music, make calls, send and receive messages, provide information, news, sports scores, weather, and more&mdash;instantly.</p>\r\n<p><strong>Alexa, play music for a dinner party -</strong></p>\r\n<p>Echo Dot provides hands-free voice control for Amazon Music&mdash;just ask for your favorite artist or song, or request a specific genre or mood. You can also search for music by lyrics, when a song or album was released, or let Alexa pick the music for you. Listen to any song with Amazon Music Unlimited.</p>\r\n<p>Echo Dot also provides hands-free voice control to Pandora, Spotify, iHeartRadio, and TuneIn.</p>\r\n<p><strong>Alexa, call Mom\'s mobile -</strong></p>\r\n<p>You can call almost anyone hands-free&mdash;no tapping or searching required. Your contacts will see your number when they receive the call so they know who is calling. Set up your voice profile and teach Alexa to recognize your voice. When you say, &ldquo;Alexa, call Mom&rdquo;, Alexa will call your mom, even if you have multiple users in your home. Additionally, you can send messages via voice or text to anyone with a supported Echo device or the Alexa App.</p>\r\n<p><strong>Alexa, dim the dining room -</strong></p>\r\n<p>You can switch on the lamp before getting out of bed, turn up the thermostat while reading in your favorite chair, or dim the lights from the couch to watch a movie&mdash;all without lifting a finger&hellip;or even raising your voice. Control multiple devices at scheduled times or with a single voice command, like locking the doors and turning off the lights when you go to bed.</p>\r\n<p><strong>Alexa, what action movies are playing this weekend? -</strong></p>\r\n<p>Alexa&mdash;the brain behind Echo Dot&mdash;is built in the cloud, so it is always getting smarter. The more you use Dot, the more it adapts to your speech patterns, vocabulary, and personal preferences. And because Echo Dot is always connected, updates are delivered automatically.</p>\r\n<p>Just in the last few months they have added Alexa calling and messaging, exclusive voice-shopping deals, voice profiles, far-field voice control of Amazon Video on Fire TV, and thousands of new skills from third-party developers.</p>\r\n<p><strong>Alexa, ask Uber to request a ride -</strong></p>\r\n<p>Skills add even more capabilities like ordering a pizza from Domino\'s, requesting a ride from Uber, tracking your fitness with Fitbit, ordering flowers from 1-800-Flowers, controlling your TV with DISH Hopper, and more. Enabling skills lets your Echo Dot do even more&mdash;simply discover skills you want to use in the Alexa App. To enable a new skill, just ask Alexa.</p>\r\n<p>Alexa, reorder coffee - <br />Get even more from Echo Dot with Prime and enjoy ad-free streaming of over 2 million songs with Prime Music.</p>\r\n<p>You can also order millions of products using only your voice and gain access to weekly Alexa shopping deals. All voice orders include fast, free shipping, and Alexa can even track your delivery for you.</p>',2,'2017-12-17 17:02:21',0,'2017-12-17 17:33:52',0),(15,20,'<p>The Blink Video Doorbell will cost US$99 and be on show at CES 2018 in Las Vegas, which kicks off on January 9. Below are some of it\'s features. Please check them out.</p>\r\n<p><strong>HD Video - </strong>The 720p HD security camera system ensures that you get a clear view of your home or business, with minimal distortion or blurring.</p>\r\n<p><strong>Motion Detection - </strong>Blink&rsquo;s feature-rich system includes a motion activated camera; when armed, any detected motion triggers the recording of a short video clip.</p>\r\n<p><strong>Instant Alerts - </strong>Quickly receive a push notification alert with a link to the video attached, so you can decide how to respond.</p>\r\n<p><strong>Live View Mode - </strong>Easily access on-demand video streaming through the Blink app.</p>\r\n<p><strong>Instant On -</strong>With Blink&rsquo;s Instant On feature, video recording starts within a fraction of a second, so you&rsquo;ll get a clear look at who or what triggered the alert.</p>\r\n<p><strong>Temperature Sensor - </strong>Blink has a built in temperature sensor that you can monitor at all times at each cameras location.</p>\r\n<p><strong>Auto-arm/Disarm Function - </strong>In addition to manually arming and disarming your Blink system, you will be able to arm/disarm the system automatically! Schedule these times in advance to define when the system is active.</p>\r\n<p><strong>Multi-System Support - </strong>Use Blink to watch your house, vacation home, or business all at the same time! You have the ability to control multiple Blink systems from within one single Blink application.</p>\r\n<p><strong>Built-in Microphone - </strong>A built-in microphone allows one-way audio access, so you can both see and hear what&rsquo;s happening at home.</p>\r\n<p><strong>Privacy Assurance - </strong>A non-hackable, hardware-based LED indicator lets you know when Blink is recording, or in Live View mode, so you&rsquo;ll never be caught off guard.</p>\r\n<p><strong>Voice Controlled with Amazon Alexa! - </strong>Add the Blink for Home skill through your Amazon Alexa app and arm, disarm and receive system information using your voice alone!</p>\r\n<p><strong>Low-Light Illumination - </strong>The built-in LED illuminator couples with the advanced low-light performance of our proprietary technology to ensure that you always receive full-color, HD quality video, day or night.</p>',2,'2017-12-20 18:22:03',0,'2017-12-20 18:22:52',0),(16,21,'<p>Game developer Niantic is using Apple\'s ARKit to integrate augmented reality feature in the game. That feature is now called as AR+.</p>\r\n<p>Pokemon Go just used phone\'s gyroscope sensor, Pok&eacute;mon just sort of floated about in the space in front of you. You could turn left/right to aim, but if you tried moving closer or further away, the Pok&eacute;mon would just glide around with you.</p>\r\n<p>New features added, according to Niantic -</p>\r\n<p style=\"padding-left: 30px;\">You will find Pokemon the same old way, walk around, look for Pok&eacute;mon to pop up on the map, and tap on Pokemon to catch.</p>\r\n<p style=\"padding-left: 30px;\">Once a flat surface is detected , you&rsquo;ll see a few patches of tall grass in front of you. You will have to tap on grass to see the Pokemon.</p>\r\n<p style=\"padding-left: 30px;\">One way to aim your throws is to get closer and personal with the Pokemon. The closer you get, the easier it&rsquo;ll be to land those great/excellent tosses</p>\r\n<p style=\"padding-left: 30px;\">There is an icon on Pokemon which shows how freaked out ther are. If you get too close to them too fast then they will run.</p>\r\n<p style=\"padding-left: 30px;\">Pokemons will be more friendly with you if you feed them nanab berries.</p>\r\n<p style=\"padding-left: 30px;\">&ldquo;Expert Handler&rdquo; mode starts if you get close enough to the Pokemon.You will get a bit more XP and Stardust out of your catch.That little catch rate increase might make it all worth it.</p>\r\n<p>Since AR+ is all built on Apple&rsquo;s ARKit engine, it&rsquo;s iOS only for now which is not a good news for Android users. There is no news from Niantic whether they&rsquo;re working on making it play friendly with Google\'s Augmented Reality Kit (ARCore). Rolling out a noteable new feature to users on just one platform is a risky choice &ndash; particularly when said feature brings things like improved catch rates and extra XP. Hopefully Niantic is working on figuring out how to bring this to Android.</p>',2,'2017-12-21 16:52:47',0,'2017-12-21 16:54:47',0),(17,22,'<p>They\'re generally much lighter than other types of rechargeable batteries of the same size. The electrodes of a lithium-ion battery are made of lightweight lithium and carbon. Lithium is also a highly reactive element, meaning that a lot of energy can be stored in its atomic bonds. This translates into a very high energy density for lithium-ion batteries. Here is a way to get a perspective on the energy density. A typical lithium-ion battery can store 150 watt-hours of electricity in 1 kilogram of battery. A NiMH (nickel-metal hydride) battery pack can store perhaps 100 watt-hours per kilogram, although 60 to 70 watt-hours might be more typical. A lead-acid battery can store only 25 watt-hours per kilogram. Using lead-acid technology, it takes 6 kilograms to store the same amount of energy that a 1 kilogram lithium-ion battery can handle. That\'s a huge difference.&nbsp;</p>\r\n<p>They hold their charge. A lithium-ion battery pack loses only about 5 percent of its charge per month, compared to a 20 percent loss per month for NiMH batteries.&nbsp;</p>\r\n<p>They have no memory effect, which means that you do not have to completely discharge them before recharging, as with some other battery chemistries.&nbsp;</p>\r\n<p>Lithium-ion batteries can handle hundreds of charge/discharge cycles.</p>',2,'2017-12-27 20:56:27',0,'2017-12-27 20:56:54',0),(19,25,'<p>In order to use these third-party app integrations, you\'ll have to start the process on your phone.</p>\r\n<p>1. Make sure you have the Uber app installed, an account created and a payment method linked to your account</p>\r\n<p>2. Open the Google Home app, go to Devices, then Google Home settings</p>\r\n<p>3. Tap on More, then Services and scroll down to find Uber</p>\r\n<p>4. If your Uber account isn\'t already linked, tap Link account</p>\r\n<p>5. A browser window will open asking for your Uber account and password</p>\r\n<p>6. Once you accept the integration, your account is linked to Google Home</p>\r\n<p>Once you\'re done with that setup, you\'re back to using your voice. To start the process, you can say either \"OK Google, get me an Uber\" or \"OK Google, request an Uber\" and you\'ll be handed off to an Uber-specific voice interface. The first time you use it, it\'ll ask you to confirm your pickup address. Then, it will note how far away the nearest UberX driver is, and as you whether or not you want a pickup &mdash; if surge pricing is in effect, you\'ll be informed before you confirm your pickup.</p>',2,'2018-02-06 19:04:42',2,'2018-02-06 19:04:42',0),(20,25,'<p>In order to use these third-party app integrations, you\'ll have to start the process on your phone.</p>\r\n<p>1. Make sure you have the Uber app installed, an account created and a payment method linked to your account</p>\r\n<p>2. Open the Google Home app, go to Devices, then Google Home settings</p>\r\n<p>3. Tap on More, then Services and scroll down to find Uber</p>\r\n<p>4. If your Uber account isn\'t already linked, tap Link account</p>\r\n<p>5. A browser window will open asking for your Uber account and password</p>\r\n<p>6. Once you accept the integration, your account is linked to Google Home</p>\r\n<p>Once you\'re done with that setup, you\'re back to using your voice. To start the process, you can say either \"OK Google, get me an Uber\" or \"OK Google, request an Uber\" and you\'ll be handed off to an Uber-specific voice interface. The first time you use it, it\'ll ask you to confirm your pickup address. Then, it will note how far away the nearest UberX driver is, and as you whether or not you want a pickup &mdash; if surge pricing is in effect, you\'ll be informed before you confirm your pickup.</p>',2,'2018-04-07 17:43:54',2,'2018-04-07 17:43:54',0),(21,25,'<p>In order to use these third-party app integrations, you\'ll have to start the process on your phone.</p>\r\n<p>1. Make sure you have the Uber app installed, an account created and a payment method linked to your account</p>\r\n<p>2. Open the Google Home app, go to Devices, then Google Home settings</p>\r\n<p>3. Tap on More, then Services and scroll down to find Uber</p>\r\n<p>4. If your Uber account isn\'t already linked, tap Link account</p>\r\n<p>5. A browser window will open asking for your Uber account and password</p>\r\n<p>6. Once you accept the integration, your account is linked to Google Home</p>\r\n<p>Once you\'re done with that setup, you\'re back to using your voice. To start the process, you can say either \"OK Google, get me an Uber\" or \"OK Google, request an Uber\" and you\'ll be handed off to an Uber-specific voice interface. The first time you use it, it\'ll ask you to confirm your pickup address. Then, it will note how far away the nearest UberX driver is, and as you whether or not you want a pickup &mdash; if surge pricing is in effect, you\'ll be informed before you confirm your pickup.</p>',2,'2018-04-20 21:45:22',2,'2018-04-20 21:45:22',0),(22,30,'<p><em>Psych</em>&nbsp;debuted on Friday, July 7, 2006, immediately following the&nbsp;<a title=\"Monk (season 5)\" href=\"https://en.wikipedia.org/wiki/Monk_(season_5)\">fifth-season</a>&nbsp;premiere of&nbsp;<em><a title=\"Monk (TV series)\" href=\"https://en.wikipedia.org/wiki/Monk_(TV_series)\">Monk</a></em>, and continued to be paired with the series until&nbsp;<em>Monk</em>\'s conclusion on December 4, 2009. During the&nbsp;<a title=\"Psych (season 2)\" href=\"https://en.wikipedia.org/wiki/Psych_(season_2)\">second season</a>, an animated segment titled \"The Big Adventures of Little Shawn and Gus\" was added to the series.&nbsp;<em>Psych</em>&nbsp;was the highest-rated&nbsp;<a title=\"United States\" href=\"https://en.wikipedia.org/wiki/United_States\">U.S.</a>&nbsp;<a class=\"mw-redirect\" title=\"Basic cable\" href=\"https://en.wikipedia.org/wiki/Basic_cable\">basic cable</a>&nbsp;<a title=\"Television\" href=\"https://en.wikipedia.org/wiki/Television\">television</a>&nbsp;premiere of 2006.<sup id=\"cite_ref-Futon-BCP_4-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Psych#cite_note-Futon-BCP-4\">[4]</a></sup>&nbsp;USA Network renewed the series for an eighth season on December 19, 2012, to include eight episodes, and ordered two more episodes on June 25, 2013, bringing the episode order to ten.<sup id=\"cite_ref-season8_5-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Psych#cite_note-season8-5\">[5]</a></sup><sup id=\"cite_ref-6\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Psych#cite_note-6\">[6]</a></sup>&nbsp;On February 5, 2014, USA Network confirmed that the eighth season of&nbsp;<em>Psych</em>&nbsp;would be its last, with the series finale airing on March 26, 2014.<sup id=\"cite_ref-last_season_7-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Psych#cite_note-last_season-7\">[7]</a></sup></p>',5,'2018-04-22 20:46:41',5,'2018-04-22 20:46:41',0),(23,25,'<p>I really like this website now. why we can do with it is to use to communicate better with our students. But again let\'s see how students are going to react to it</p>',22,'2018-05-04 14:16:15',22,'2018-05-04 14:16:15',0);
